  Description: 'Skelly\''s Farm Market is open from June-Oct with homegrown strawberries
    in June, sweet corn, melons, tomatoes, and other summer produce in July-Aug, Skelly\''s
    Sunflower Experience in late July lasting two weeks, and lots of fall fun including
    pumpkins, two awesome corn mazes, Choose-Your-Farm-Adventure wagons rides, and
    more. Plus, during all of our seasons visit our bakery with homemade donuts and
    more, our huge gift shop selling rustic decor, and our fantastic free playground.


    Plus, visit our 8 remote roadside stands for produce in July-Aug, an see us at
    the Saturday Janesville Farmers Market.'
